import DefaultLayout from './layouts/DefaultLayout';
import PlanFinder from './components/UlapPayroll/PlanFinder';
import Home from './components/Ulap/Home';

const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      {
        path: '/plan-finder',
        element: PlanFinder,
      },
    ],
  },
];

export default routes;
plan-finder
